import React from "react";

class ToneButton extends React.Component {
  render() {
    return (
      <button
        style={{
          color: this.props.color
        }}
      >
        test
      </button>
    );
  }
}

const toneButtonStyle = {
  position: "absolute",
  width: "80%",
  top: "50%",
  left: "50%",
  "border-radius": "100%",
  transform: "translate(-50%, -50%)",
  cursor: "pointer"
};

class Library extends React.Component {
  render() {
    return (
      <ul>
        {this.props.colors.map(color => (
          <li className="libraryButton" key={color}>
            <ToneButton color={color} style={toneButtonStyle} />
          </li>
        ))}
      </ul>
    );
  }
}

export default class LibraryContainer extends React.Component {
  render() {
    return (
      <div>
        <Library
          colors={[
            "#fe6b12",
            "#fec52b",
            "#029e4e",
            "#e11a79",
            "#6581c9",
            "#7f47dd"
          ]}
        />
      </div>
    );
  }
}
